Star Wars: Honor Among Thieves, is a novel written by Daniel Abraham and Ty Franck under the pseudonym James S. A. Corey, and is part of the upcoming Empire and Rebellion series.[3] The story takes place before the events in Star Wars Episode V: The Empire Strikes Back.[1] It was released on March 4, 2014.[2] The novel also includes the short story &quot;Silver and Scarlet&quot; that was also written by James S. A. Corey.[4]
